export default function Hero() {
    return (
        <section className="Hero">
            <h1>My awesome lab</h1>
            <p>Enter nickname to start chatting</p>
            <form className="login-form" action="">
                <input id="login-textarea" type="text" maxlength="18" placeholder="Big Bob" />
                <input id="login-button" className="login-button" type="button" value="Start Chatting" />
            </form>
        </section>
    );
}
